import React, { Component } from "react";
import Player from "./player";

class Players extends Component {
  state = {};
  render() {
    const { id, player } = this.props;
    return (
      <div className="container">
        <p>{id}</p>
        <p>{player}</p>
      </div>
    );
  }
}

export default Players;

